package com.system.domain;import com.system.enumeration.BrowserEnum;import com.system.enumeration.StatusCodeEnum;import java.net.URL;import java.util.Date;/** * Created by dev.yungiggs on 2016. 10. 21.. */public class Log {    private StatusCodeEnum statusCode;    private URL url;    private BrowserEnum browser;    private Date date;    public StatusCodeEnum getStatusCode() {        return statusCode;    }    public void setStatusCode(StatusCodeEnum statusCode) {        this.statusCode = statusCode;    }    public URL getUrl() {        return url;    }    public void setUrl(URL url) {        this.url = url;    }    public BrowserEnum getBrowser() {        return browser;    }    public void setBrowser(BrowserEnum browser) {        this.browser = browser;    }    public Date getDate() {        return date;    }    public void setDate(Date date) {        this.date = date;    }}